import React, { Component } from 'react'


class AddPhoto extends Component {
    render() {
        return (
            <div>
                <h1>Photo Frame</h1>
                <div>
                    <form>
                        <input type="text" placeholder="Link" />
                        <input type="text" placeholder="Description" />
                    </form>
                </div>
            </div>
        );
    }
}

export default AddPhoto
